from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    if not triples:
        return sentence

    subject = triples[0].subject
    clauses = []

    for triple in triples:
        predicate = triple.predicate
        object_ = triple.object

        if predicate == "alternativeName":
            clauses.append(f"{subject} is also known as {object_}")
        elif predicate == "creator":
            clauses.append(f"{subject} was created by {object_}")
        elif predicate == "fullName":
            clauses.append(f"{subject}'s full name is {object_}")
        elif predicate == "birthPlace":
            clauses.append(f"{subject} was born in {object_}")
        elif predicate == "nationality":
            clauses.append(f"{subject} is of {object_} nationality")
        elif predicate == "starring":
            clauses.append(f"{subject} stars {object_}")
        elif predicate == "firstAired":
            clauses.append(f"{subject} first aired on {object_}")
        elif predicate == "broadcastedBy":
            clauses.append(f"{subject} is broadcast by {object_}")
        elif predicate == "award":
            clauses.append(f"{subject} won the {object_}")
        else:
            clauses.append(f"{subject} {predicate} {object_}")

    sentence = " ".join(clauses) + "."
    return sentence

